import '../design/lucros.css';
import dados from '../dados/dadosUsina.json';
import dadosClientes from '../dados/dadosClientes.json';

function lucro() {
   var EnergiaGerada = 0;
   var custoEnergia = 0.95;
   var tempo = dados[1].tempo_h - dados[0].tempo_h;
   dados.map((e) => (lucro += e.potencia_kW))
   dadosClientes.map((e,key) => (console.log((e.usinas[0].percentualDeParticipacao/100)*lucro)))
   return (
      <div className="mainLucro">
         <header className="appBarLucro">

         </header>
         <main className="mainLucro">
            <div className="lucro">
               
                
                  <p>Lucro do dia:  R$ {(tempo*lucro)*custoEnergia}</p><br/>
                   {dadosClientes.map((e) => (<p>{e.nomeCliente}</p>,<p>{}</p>))}
            </div>
         </main>
      </div>
   )
}
export default lucro;
